import React, { Component } from 'react'

export class App extends Component {

  constructor(){
    super();
    this.state={
      speed : 10
    }
  }
  render() {
    return (
      <div>
        <h1>{this.state.speed}</h1>
      </div>
    )
  }
}

export default App
